            font-size: @16px;
            color: #141B1F;
            width: @53px;
            height: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
            line-height: 120%;
          }

          input {
            background: none;
            outline: none;
            border: none;
            font-size: @16px;
            width: 100% - @53px;
          }


        }

        &-buttons {
          width: @351px;
          display: flex;
          justify-content: space-between;
          margin-top: @30px;
          font-size: @16px;

          div {
            width: @170px;
            height: @56px;
            background-color: #D3CFCE;
            display: flex;
            justify-content: center;
            align-items: center;
            border-radius: @4px;
            color: #141B1F;
            opacity: .8;
            transition: .1s;

            &:hover {
              opacity: 1;
            }

            &:nth-child(1) {
              color: #fff;
              background-color: #E3256B;
              box-shadow: 0 @10px @40px #E3256BB2;
            }
          }
        }
      }
    }

    &-body {
      position: absolute;
      left: @333px;
      top: @54px;
      width: @920px;
      display: flex;
      flex-direction: column;
      align-items: flex-start;

      &__buttons {
        display: flex;
        flex-direction: row;
        justify-content: center;
      }

      &__button {
        display: flex;
        justify-content: center;
        align-items: center;
        padding: @24px @44px;
        background-color: #ffffff1a;
        border-radius: @4px;
        font-size: @16px;
        margin-bottom: @60px;
        margin-right: @24px;
        transition: .1s;

        &:hover {
          background-color: #fff3;
        }

        img {
          width: @24px;
          margin-right: @16px;
        }
      }

      .farm-statistic-body-information {
        hr {
          margin: auto @40px 0 0 !important;
        }

        div {
          margin-right: @40px;
        }
      }

      &-content {
        display: grid;
        grid-gap: @100px;
        grid-template-columns: repeat(7, @71px);

        &-block {
          display: flex;
          height: @350px;
          flex-direction: column;
          align-items: center;

          &__money {
            margin: auto 0 @8px;
            font-size: @22px;
          }

          &__column {
            border-radius: @6px;
            background: linear-gradient(180deg, #FFFFFF 0%, rgba(255, 255, 255, 0) 100%);
            opacity: .2;
            width: @50px;
          }

          &__name {
            margin-top: @16px;
            text-align: center;
            line-height: 100%;
            font-size: @16px;
          }

          &__lvl {
            font-size: @16px;
            margin-top: @6px;
            line-height: 100%;
            opacity: .4;
          }
        }

      }
    }
  }

  &-best {
    width: 100vw;
    height: 100vh;
    position: absolute;
    left: 0;
    top: 0;
    display: flex;
    justify-content: center;
    align-items: center;

    &-content {
      position: relative;
      width: @1652px;
      height: @1080px;
      display: flex;
      justify-content: center;
      align-items: center;

      &__background {
        width: @1652px;
      }

      &-block {
        width: @303px;
        height: @400px;
        position: absolute;
        display: flex;
        flex-direction: column;
        align-items: center;
        text-align: center;

        &_0 {
          left: @272px;
          top: @496px;
          transform: rotate(4deg);

          .farm-best-content-block__id {
            margin-top: @155px;
          }
        }

        &_1 {
          left: @680px !important;
          top: @510px;
          transform: rotate(-4deg);
        }

        &_2 {
          left: @1115px !important;
          top: @512px;
        }

        &__id {
          font-size: @32px;
          color: #482502;
          opacity: .6;
          line-height: 110.5%;
          margin-top: @133px;
        }

        &__name {
          font-size: @44px;
          opacity: 1;
          color: #482502;
          line-height: 80%;
          margin-top: @4px;
        }

        &__exp {
          font-size: @37px;
          color: #AE2121;
          line-height: 110.5%;
          margin-top: @40px;

          span {
            font-size: @20px;
          }
        }

      }


    }

  }
}

.displayNone {
  display: none;
}
